import React from "react";

const About = () => {
	return (
		<div className="container-fluid about bg-light px-0">
			<div className="container jumbotron mb-0 bg-transparent">
				<p className="text-center quote font-italic">
					<q>
						Together, we <span className="font-weight-bold">the people</span> arise and take responsibility in our country. I am
						for the people, available and accessible.
					</q>
				</p>
			</div>
			<div className="bg-primary">
				<div className="container text-light py-5">
					<div className="col-lg-4">
						<h2>Olamijuwonlo's Priorities</h2>
					</div>
				</div>
			</div>
		</div>
	);
};

export default About;
